					if (table.pk) {
						var pk = table.pk;
						var addr = pk.onrightfn(r);
						table.uniqs[pk.hh][addr] = r;
					}
					if (table.uk && table.uk.length) {
						table.uk.forEach(function (uk) {
							var ukaddr = uk.onrightfn(r);
							table.uniqs[uk.hh][ukaddr] = r;
						});
					}
